--LIST PARTITIONED DATA

DECLARE
    TYPE REGARRAY is VARRAY(14) OF VARCHAR2(2);
    TYPE BRANCHARRAY IS VARRAY(10) OF NUMBER;
    TYPE STATUSARRAY IS VARRAY(3) OF VARCHAR2(2);
    region REGARRAY;
    branch BRANCHARRAY;
    status STATUSARRAY;
BEGIN
    region := REGARRAY('OR','WA','AZ', 'UT', 'NM','NY', 'VM', 'NJ','FL', 'GA','SD', 'WI','OK', 'TX');
    branch := BRANCHARRAY(100,101,102,200,201,202,300,301,302,400);
    status := STATUSARRAY('C', 'I', 'P');
    FOR i in 1..1000000 
    LOOP
        If mod(i, 10000) = 0 then 
        Commit; 
        End if; 
    END LOOP; 
END;
/

